        axios.get('http://localhost:3001/api/get').then((item)=>{
           setdata(item.data);
        }).catch((error)=>{
            alert('retry Again')
        })
    }

    useEffect(()=>{
        getDetails();
    },[])
    return (
        <div>
            Homepage
        </div>
    )
}

